    false,nt"url": null,nt"notes": "This report analyzes the effectiveness
    of No. 4 and No. 6 lead shot for hunting ducks on Lacassine National Wildlife Refuge
    between 1980 and 1982. Relative effectiveness of No. 4 steel and No. 6 lead shot
    for hunting ducks was tested under field conditions on Lacassine National Wildlife
    Refuge during the 1980-81 and 1981-82 waterfowl seasons. Federal Hi-Power No. 6
    lead was compared with Federal No. 4 steel in 2-3/4 inch 12-gauge loads. Significantly
    more ducks were hit per shot fired (P 32 m).",nt"license_title": "License
